fWorlkDis:散步距离
fPursueDis:追击距离
fRunAwayDis:逃跑距离:作者:
被打以后逃跑的范围

RunAwayOnly:只逃跑:作者:
只要不等于0 就是逃跑AI怪物
shift:是否可位移:作者:
0是可以位移
1是不可位移
safeatk:安全不可攻击
Warn:是否触发警戒距离脚本:0为正常，1为读取触发警戒距离脚本
--]]
